/** 
 * @param {string} s
 * @return {number}
 */
var minimumSteps = function (s) {
    let count = 0;
    let findIndex = s.length - 1
    let sa = s.split("")
    do {
        if (sa[findIndex] != 1) {
            // start to time first one
            let tmpStep = 1
            let find = false;
            while (findIndex - tmpStep >= 0) {
                if (sa[findIndex - tmpStep] == 1) {
                    find = true
                    break;
                }
                tmpStep++
            }
            if (find) {
                [sa[findIndex], sa[findIndex - tmpStep]] = [sa[findIndex - tmpStep], sa[findIndex]]
                count += tmpStep
            } else {
                break;
            }
        } else {
            findIndex--
        }
    } while (findIndex != 0)
    return count;
};


var minimumSteps = function (s) {
    let count_0 = 0, count_1 = 0
    let sum = 0
    let sa = s.split("")
    sa.map((v) => {
        if (v == 0) {
            count_0++
        } else {
            count_1++;
        }
    })
    // console.log(count_0, count_1)

    let sa_l = sa.slice(0, count_0)
    let sa_r = sa.slice(count_0)
    let sa_l_i = 0;
    let sa_r_i = 0;
    let swap_time = 0
    do {
        sa_l_i_new = sa_l.indexOf('1', sa_l_i)
        sa_r_i_new = sa_r.indexOf('0', sa_r_i)
        // console.log(sa_l_i, sa_l_i_new, sa_r_i, sa_r_i_new)
        if (sa_l_i_new >= 0) {
            // console.log(count_0 - sa_l_i_new - sa_l_i, sa_r_i_new - sa_r_i)
            sum += ((count_0 - sa_l_i_new - sa_l_i + swap_time) + (sa_r_i_new - sa_r_i))
            sa_l_i = sa_l_i_new + 1
            sa_r_i = sa_r_i_new + 1
            swap_time += 2
        } else {
            break;
        }
    } while (true)
    return sum;
};
